insert  into `blog`(`id`,`title`,`content`,`utime`,`readCount`,`tags`,`ctime`) values (4,'test56','yuy分割父火火&nbsp; 结核杆菌好好几个或过过军或或或或过 还干活干活干活框架和空间即可健康就好',1562414766,45,'hggj,tiyt,ghhg',1562414766),(5,'test56','\n        Go ahead…dsadwewqrew',1562414766,22,'hggj',1562414766),(6,'测试6','uyyewrweiyrwue',1562465244,22,'test6,test7',1562465244),(7,'测试6','\n        uyyewrweiyrwue\n      ',1562465244,23,'test6,test7',1562465244),(8,'IP地址','IP地址（Internet Protocol Address）是指互联网协议地址，又译为网际协议地址。IP地址是IP协议提供的一种统一的地址格式，它为互联网上的每一个网络和每一台主机分配一个逻辑地址，以此来屏蔽物理地址的差异。',1562468126,20,'IP',1562468126),(25,'PC端微信','<img src=\"data:image/png;base64,\"><div>这是我的QQ头像！</div>',1562546289,21,'weixin',1562546289),(39,'大吉大利晚上吃鸡','<p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">《绝地求生大逃杀》最近在各大直播平台上火了，一个被叫做“吃鸡”的游戏，原因是每局游戏结束时，最终获胜者的屏幕将出现这句“大吉大利，晚上吃鸡”，英文版的是“WINNER WINNER ,CHICKEN DINNER“。</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">吃鸡对配置要求还是挺高的，在各种搜贴看贴确定自己配置还能勉强跑的动后果断入手了，这居然是自己在steam上购买的第一款游戏！<span id=\"more-2492\" style=\"box-sizing: border-box;\"></span></p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">官方给出的最低配置是：<br style=\"box-sizing: border-box;\">CPU：Intel Core i3-4340 / AMD FX-6300<br style=\"box-sizing: border-box;\">显卡：nVidia GeForce GTX 660 2GB / AMD Radeon HD 7850 2GB<br style=\"box-sizing: border-box;\">内存：6 GB RAM</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">我的是i5 3470、8G1600、7870冰酷2G、128Gssd，五年前的老配置了。</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">显卡overdriver中把频率上调到1150左右，功耗拉满。游戏中抗锯齿最高、视距高，其它最低，分辨率720， 帧数野外时有近一百，平均七八十帧，房子一多就会掉到二三十，偶尔会卡到个位数。显卡温度70+，显存和内存吃满，四核心基本满负荷！</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">山东青岛联通，没使用加速器，裸连，基本能玩，偶尔开关门和捡物品时会有延迟，对于苟来说基本不影响。</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">没有好友，只玩单排，各种服随机进，一群老阴逼。由于分辨率低，稍远就人草不分，要活着只能靠苟，全程趴和爬。玩了两晚上，游戏7个小时，勉强吃到一次鸡。</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\"><img src=\"data:image/png;base64,',1562548155,25,'chiji',1562548155),(42,'大吉大利晚上吃鸡','<p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">《绝地求生大逃杀》最近在各大直播平台上火了，一个被叫做“吃鸡”的游戏，原因是每局游戏结束时，最终获胜者的屏幕将出现这句“大吉大利，晚上吃鸡”，英文版的是“WINNER WINNER ,CHICKEN DINNER“。</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">吃鸡对配置要求还是挺高的，在各种搜贴看贴确定自己配置还能勉强跑的动后果断入手了，这居然是自己在steam上购买的第一款游戏！<span id=\"more-2492\" style=\"box-sizing: border-box;\"></span></p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">官方给出的最低配置是：<br style=\"box-sizing: border-box;\">CPU：Intel Core i3-4340 / AMD FX-6300<br style=\"box-sizing: border-box;\">显卡：nVidia GeForce GTX 660 2GB / AMD Radeon HD 7850 2GB<br style=\"box-sizing: border-box;\">内存：6 GB RAM</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">我的是i5 3470、8G1600、7870冰酷2G、128Gssd，五年前的老配置了。</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">显卡overdriver中把频率上调到1150左右，功耗拉满。游戏中抗锯齿最高、视距高，其它最低，分辨率720， 帧数野外时有近一百，平均七八十帧，房子一多就会掉到二三十，偶尔会卡到个位数。显卡温度70+，显存和内存吃满，四核心基本满负荷！</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">山东青岛联通，没使用加速器，裸连，基本能玩，偶尔开关门和捡物品时会有延迟，对于苟来说基本不影响。</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\">没有好友，只玩单排，各种服随机进，一群老阴逼。由于分辨率低，稍远就人草不分，要活着只能靠苟，全程趴和爬。玩了两晚上，游戏7个小时，勉强吃到一次鸡。</p><p style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\"><img src=\"data:image/png;base64,\"><br></p>',1562549582,48,'chiji',1562549582),(43,'data和computed区别','<h2 class=\"heading\" style=\"box-sizing: border-box; outline: 0px; margin-top: 8px; margin-bottom: 16px; padding: 0px; font-size: 24px; font-family: &quot;Microsoft YaHei&quot;, &quot;SF Pro Display&quot;, Roboto, Noto, Arial, &quot;PingFang SC&quot;, sans-serif; color: rgb(79, 79, 79); line-height: 32px; overflow-wrap: break-word;\">首先我们先说一下，为什么官方示例当中是绑定到computed里面的?</h2><div><ol class=\"hljs-ln\" style=\"box-sizing: border-box; outline: 0px; margin-bottom: 0px; margin-left: 0px; list-style: none; font-family: &quot;Microsoft YaHei&quot;, &quot;SF Pro Display&quot;, Roboto, Noto, Arial, &quot;PingFang SC&quot;, sans-serif; border-collapse: collapse; font-size: 16px; overflow: hidden; overflow-wrap: break-word; color: rgb(56, 58, 66); white-space: pre; width: 1161px;\"><li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; list-style-type: none; overflow-wrap: break-word; height: 22px;\"><div class=\"hljs-ln-code\" style=\"box-sizing: border-box; outline: 0px; margin: 0px 0px 0px 8px; padding: 0px; overflow-wrap: break-word; font-family: &quot;Source Code Pro&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Ubuntu Mono&quot;, &quot;Anonymous Pro&quot;, &quot;Droid Sans Mono&quot;, Menlo, Monaco, Consolas, Inconsolata, Courier, monospace, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 14px; float: left; height: 22px;\"><div class=\"hljs-ln-line\" style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; overflow-wrap: break-word;\">那么后面无论怎么修改vuex的state状态，<span class=\"hljs-keyword\" style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; color: rgb(166, 38, 164); overflow-wrap: break-word;\">data</span>中对属性值是不会变化的,<span style=\"font-family: &quot;Microsoft YaHei&quot;, &quot;SF Pro Display&quot;, Roboto, Noto, Arial, &quot;PingFang SC&quot;, sans-serif; font-size: 16px;\">而 computed 则是通过依赖实现的，计算属性在它的相关依赖发生改变时会重新求值。</span></div></div></li><li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; list-style-type: none; overflow-wrap: break-word; height: 22px;\"><div class=\"hljs-ln-numbers\" style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; overflow-wrap: break-word; font-family: &quot;Source Code Pro&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Ubuntu Mono&quot;, &quot;Anonymous Pro&quot;, &quot;Droid Sans Mono&quot;, Menlo, Monaco, Consolas, Inconsolata, Courier, monospace, &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 14px; float: left; height: 22px; width: 24px; border-right: 1px solid rgb(197, 197, 197);\"><div class=\"hljs-ln-line hljs-ln-n\" data-line-number=\"2\" style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px 8px 0px 0px; text-align: right; overflow-wrap: normal;\"></div></div></li></ol></div>',1562655030,26,'test7',1562655030),(44,'data和computed区别','那么后面无论怎么修改vuex的state状态，data中对属性值是不会变化的,而 computed 则是通过依赖实现的，计算属性在它的相关依赖发生改变时会重新求值。<div><br></div>',1562727349,27,'test7',1562727349);

